%[text] # Exemple of LMI using the phasorArray toolbox
%[text] This script display a range of example of LMI built using the toolbox
%%
%[text] Creation of a random PhasorArray, using the "time\_structure" argument which specifies hurwitz
h=15;
nx=6;
T=1 %period %[output:520c1bf5]
A=(PhasorArray(rand_phasor(nx,nx,5,"time_structure","hurwitz","hurwitzeig",[(-1:-1:-nx)/10-2]))); %Creation of a PhasorArray object
A=mreal(A); %to extract only real part of A, rand_phasor can produce complex valued periodic matrices


N=N_tb(nx,h,T);

figure(10)
clf %[output:6fef7907]
stem(A)
sgtitle('Stem of A') %[output:6fef7907]
%[text] HmqNeig calculates the eigenvalues of (A-N), provided that A represents a square periodic matrix
figure(11)
plot(A.HmqNEig(h,T),'o') %[output:6fef7907]
title('eig(A-N)') %[output:6fef7907]

figure(12)
hmq_sim(A.Value,10,rand(nx,1),1,"plot",true); %[output:78e51d45] %[output:6ce097c2]
sgtitle("\dot x = A(t)x",'Interpreter','tex')

figure(13)
plot(A,T,0:0.01:2,title='A(t)')
%%
%[text] ## Stability
%[text] ### Do first the product between phaseor objects, then construct the Toeplitz Blocks Matrix
h=10 %[output:7b26b3a3]

P=PhasorArray.ndsdpvar(size(A,1),size(A,1),h,"PhasorType",'symmetric',"real",true) %[output:20f34cac]

PT=P.T_tb(h);
t1=tic();

%product between phaseor objects
ATP=(A.')*P;
PA=P*A;
ATPpPA=(ATP+PA) %[output:5e9294e7]

%Building the Toeplitz Blocks Matrix
ATPpPA.T_tb(h);

F=[PT>=0,ATPpPA.T_tb(h) + N_tb(nx,h,1)*PT-PT*N_tb(nx,h,1)<=-(eye(size(A.T_tb(h),1))*10)] %[output:9bec489a]
toc(t1) %[output:0a0005ea]
optimize(F) %[output:5b126ce6] %[output:0ca497fb]
toc(t1) %[output:3c1ef137]
%
Pf=sdpval(P);

figure(20)
Pf.plot %[output:3875a273]
sgtitle("P(t)") %[output:3875a273]
%%
%[text] ### Stability analysis, using the corrective TB hankel matrices
h=10 %[output:683c3645]

t1=tic();
P=PhasorArray.ndsdpvar(size(A,1),size(A,2),h,"PhasorType",'symmetric',"real",true) %[output:5376e934]

PT=P.T_tb(h);
ATB=A.T_tb(h);

[AHpJ,~,~,AHm]=A.TBHankel(h);
[~,AtJHm,AtHp,~]=TBHankel(A.',h);
[PHpJ,PJHm,PHp,PHm]=P.TBHankel(h);
F=[PT>=0; %[output:group:28416ee7] %[output:7dede82a]
(ATB'+N_tb(A,h))*PT+PT*(ATB-N_tb(A,h))+... %[output:7dede82a]
AtHp*PHm+PHp*AHm+... %[output:7dede82a]
AtJHm*PHpJ+PJHm*AHpJ<=0] %[output:group:28416ee7] %[output:7dede82a]

toc(t1) %[output:511641af]
optimize(F) %[output:4ee2ccd2] %[output:276e3b25]
toc(t1) %[output:66d39822]
%
Pf=sdpval(P)

figure(21)
clf %[output:4d137251]
Pf.plot %[output:4d137251]
sgtitle("P(t)") %[output:4d137251]


