%[text] ## quadratic stability
hP=10;
h=10;
hb=3 %[output:1c7fea13]

nx=2 %[output:55150661]
nu=2 %[output:06a33e37]

T=5;

A=mreal(rand_phasor(nx,nx,hb,output="PhasorArray")) %[output:488614e0]

Q=PhasorArray.ndsdpvar(nx,nx,hP,PhasorType='symmetric') %[output:31740ff0]
QT=Q.T_tb(h);

%produits entre les objets phaseur
QAT=Q*(A.') %[output:6e9e6bdc]
AQ=A*Q %[output:2e554063]
QATpAQ=(QAT+AQ) %[output:1b353742]
% LMI=QATpAQ+Y+(Y.')

% Construction of the Toeplitz Blocks Matrix (matrix with Toeplitz blocks)
QATpAQ.T_tb(2*h);


B=rand_phasor(nx,nu,hb);
Y=PhasorArray.ndsdpvar(nx,nx,hP,PhasorType='full') %[output:5b473adc]

F=[QT>=eye(size(QT))];
N=N_tb(A,h,T);
F=[F,[QATpAQ.T_tb(h)-N*QT+QT*N+Y.T_tb(h)+Y.T_tb(h)'] <=-8*QT] %[output:9cf48a22]

optimize(F,-trace(Y.phas(0))) %[output:086f9771] %[output:1d9c79ad]


%
Pf=sdpval(P);

figure(22)
Q.plot(explosed=true); %[output:30ae26d8]
sgtitle("Q(t)") %[output:30ae26d8]


figure(23)
Y.plot(explosed=true); %[output:650008fc]
sgtitle("Y(t)") %[output:650008fc]


K=Y/Q;
K=PhasorArray(value(value(K))) %[output:2eb40628]
figure(24)
plot(K) %[output:10cc5a4a]

figure(25)
plot(A.HmqNEig,'*') %[output:10cc5a4a]
hold on %[output:10cc5a4a]
plot(HmqNEig(A+K),'o') %[output:10cc5a4a]

figure(26)
lsim(A+K,2,[],T); %[output:60d55271] %[output:11d99240]

