%[text] ## LQ reg H2
nx=3;
nu=3;
nha=3;
hP=10;
h=10;

T=1/2/pi %[output:437ccfe2]
x0=[1 0 0] %[output:30112d69]

Q=eye(nx) %[output:52c14207]
R=eye(nu) %[output:2eba089f]

A=mreal(rand_phasor(nx,nx,nha,'output','PhasorArray'));
B=mreal(rand_phasor(nx,nu,nha,'output','PhasorArray'));

X=PhasorArray.ndsdpvar(nx,nx,hP);
W=PhasorArray.ndsdpvar(nu,nx,hP,'PhasorType','full','real',1);
Y=PhasorArray.ndsdpvar(nu,nu,hP) %[output:915a0f47]
Gam=sdpvar(1) %[output:2d36aec9]

M1=(A*X+B*W)+(A*X+B*W).'+x0*x0';
M2=phas(trace((Q^0.5)*X*(Q^0.5).')+trace(Y),0);
M3=[-Y (R^0.5)*W;((R^0.5)*W).' -X];


N=N_tb(A,h,T);
F=[[M1.T_tb(h)-N'*X.T_tb(h)-X.T_tb(h)*N<=0];... %[output:group:612bd19e] %[output:8ce05418]
    M2<=Gam;... %[output:8ce05418]
    M3.T_tb(h)<=0] %[output:group:612bd19e] %[output:8ce05418]

obj=Gam %[output:0cecb4b0]

optimize(F,obj) %[output:3cf7472b] %[output:6fa2f567]

K=(W/X)%display controller matrix %[output:765a1158]
K=PhasorArray(value(value(K))) %[output:252f7dcf]
figure(27)
plot(K) %[output:40211f74]


figure(28)
plot(A.HmqNEig(h,T),'*') %[output:40211f74]
hold on %[output:40211f74]
plot((HmqNEig(A+B*K,h,T)),'o') %[output:40211f74]

figure(29)
lsim(A+B*K,2,[],T); %[output:08c09ff5] %[output:4b912fe7]

value(value(Gam)) %[output:8aefe8d5]

