%%
%[text] ## LQR
nx=3;
nu=3;
ny=2 %[output:27e403b2]
nha=3;
hP=10;
h=10;

T=1/10 %[output:077342d5]


A=mreal(rand_phasor(nx,nx,nha,'output','PhasorArray'));
B=mreal(rand_phasor(nx,nu,nha,'output','PhasorArray'));
C=mreal(rand_phasor(ny,nx,nha,'output','PhasorArray'));


Y=PhasorArray.ndsdpvar(nx,nx,hP);
L=PhasorArray.ndsdpvar(nu,nu,hP) %[output:27409b98]
Gam=sdpvar(1) %[output:690c1585]

%Forme Toeplitz Block de Q 
YT=Y.T_tb(h);

B=PhasorArray(eye(nx));
LMI=(A*Y + B*L)+(A*Y+B*L).';

Ql= PhasorArray(diag(10*ones(nx,1)));
Rl= PhasorArray(diag(1*ones(nx,1)));

F=[YT>=0];
N=N_tb(A,h,T);

F=[F,[-(LMI.T_tb(h)-N*YT-YT*N'), Y.T_tb(h) , L.T_tb(h)';
Y.T_tb(h) , T_tb(Ql^-1,h),  -zeros((2*h+1)*nx);
L.T_tb(h), -zeros((2*h+1)*nx), T_tb(Rl^-1,h)] >=0];

obj=-trace(Y).phas(0);
u=optimize(F,obj); %[output:7c5d9f73]


figure(30)
Y.plot(plot=true,explosed=true); %[output:8e6ef906]
sgtitle("Y(t)") %[output:8e6ef906]


figure(31)
L.plot(plot=true,explosed=true); %[output:45da6d5f]
sgtitle("L(t)") %[output:45da6d5f]

if ~u.problem %si le solver a trouvé une solution
    K=L/Y;
end

K=K.sdpval %[output:7c3f2099]
K=K.reduce("reduceMethod","relative","reduceThreshold",1e-4) %[output:108c94b8]

figure(34)
K.plot(plot=true,explosed=true); %[output:601385b0]
sgtitle("K(t)") %[output:601385b0]

figure(35)
K.stem %[output:601385b0]
sgtitle("K") %[output:601385b0]

figure(36)
plot(A.HmqNEig(h,T),'*') %[output:601385b0]
hold on %[output:601385b0]
plot(value(HmqNEig(A+B*K,h,T)),'o') %[output:601385b0]

figure(37)
lsim(A+B*K,2,[],T); %[output:68bbc414] %[output:5b8be5dc]
%%
%[text] ## LQR

Q=PhasorArray.ndsdpvar(size(A,1),size(A,2),h,"PhasorType",'symmetric',"real",true) %[output:498c20ba]


%idem pour Y
Y=PhasorArray.ndsdpvar(size(A,1),size(A,2),h,"PhasorType","full","real",true) %[output:91249539]

%Forme Toeplitz Block de Q 
QT=Q.T_tb(h);

B=PhasorArray(eye(nx));
LMI=(A*Q + B*Y)+(A*Q+B*Y).';

Ql= PhasorArray(diag(10*ones(nx,1)));
Rl= PhasorArray(diag(1*ones(nx,1)));


F=[QT>=0];
N=N_tb(A,h,1);

F=[F,[LMI.T_tb(h)-N*QT-QT*N', -Q.T_tb(h) , -Y.T_tb(h)';
-Q.T_tb(h) , -T_tb(Ql^-1,h),  -zeros((2*h+1)*nx);
-Y.T_tb(h), -zeros((2*h+1)*nx), -T_tb(Rl^-1,h)] <=0];

obj=trace(Y);
u=optimize(F,obj.phas(0)); %[output:187e0a55]


figure(40)
Q.plot(plot=true,explosed=true); %[output:3dee0ef5]
sgtitle("Q(t)") %[output:3dee0ef5]


figure(41)
Y.plot(plot=true,explosed=true); %[output:032680c1]
sgtitle("Y(t)") %[output:032680c1]

if ~u.problem %si le solver a trouvé une solution
    K=sdpval(Y)/sdpval(Q);
end

figure(42)
K.plot(plot=true,explosed=true); %[output:7178d725]
sgtitle("K(t)") %[output:7178d725]

