%%
%[text] ## Riccati LMI
%[text] $A^T P +PA -(PB +N^T)R^{-1}(B^T P +N) + Q \\geq 0$
%[text] $\\left\[\\matrix{A^TP +PA  +Q & PB +N^T \\cr (PB +N^T)^T & R} \\right\] \>0$
%[text] 
nx=2;
nu=2;

ha=3; %A truncature order
hP=10; %P truncature order
h=10;  %LMI truncature order

T=3; %period

A=PhasorArray.random(nx,nx,ha,"time_structure","real");
figure(500) %[output:6de9cdae]
clf %[output:6de9cdae]
A.plot(T) %[output:6de9cdae]
figure(501) %[output:8d604793]
clf %[output:8d604793]
plot(A.HmqNEig,'*') %[output:8d604793]


B=rand_phasor(nx,nu,ha,"output","PhasorArray");

%%%%% controllability criteria
%%% (A-N)W + W(A-N) + BB' iff Re(eig(A-N))<0

Pc=mreal(PhasorArray(Sylv_harmonique(A,A',B*B.',2*hP,1)));
figure(502) %[output:7b8d2ffb]
plot(Pc) %[output:7b8d2ffb]
trace(Pc).phas(0) %[output:35594751]
 

%ndsdpvar phasor array
P=PhasorArray.ndsdpvar(nx,nx,hP,"PhasorType",'symmetric',"real",true) %[output:4984061c]
PT=P.T_tb(h);

Q=PhasorArray(eye(nx));
QT=Q.T_tb(h);

R=PhasorArray(eye(nu));
RT=Q.T_tb(h);

N=PhasorArray(zeros(nu,nx));


[AHpJ,AJHm,AHp,AHm]=A.TBHankel(h);
[AtHpJ,AtJHm,AtHp,AtHm]=TBHankel(A.',h);

[PHpJ,PJHm,PHp,PHm]=P.TBHankel(h);
[BHpJ,BJHm,BHp,BHm]=B.TBHankel(h);

ATB=A.T_tb(h);
BTB=B.T_tb(h);

NT=N.T_tb(h);

F0=[PT>=0] %[output:37a363a9]

F11=[ATB'*PT+PT*ATB+...
AtHp*PHm+PHp*AHm+...
AtJHm*PHpJ+PJHm*AHpJ+...
N_tb(A,h,T)*PT-PT*N_tb(A,h,T)+QT];

F12=[PT*BTB+PHp*BHm+PJHm*BHpJ+NT'];

F21=F12';

F22=R.T_tb(h);

F1=[F11,F12;F21,F22];


F=[F0,F1>=0] %[output:0a8a2bef]

obj=-trace(PT) %[output:37b8bf88]
optimize(F,obj) %[output:53e47107] %[output:92f6aa45]


PP=PhasorArray(value(P.value)) %[output:3c282e3e]
figure(503) %[output:7bef75a3]
plot(PP,T,'title','P(t)') %[output:7bef75a3]

K=R\(B.'*PP+N) %[output:43613374]

figure(504) %[output:77dbacab]
plot(K,T,'title','K(t)') %[output:77dbacab]

figure(505) %[output:79426993]
plot((HmqNEig(A-B*K,10,T)),'*') %[output:79426993]
hold on %[output:79426993]
plot((HmqNEig(A,10,T)),'o') %[output:79426993]

figure(506) %[output:10daf3d2]
yyaxis left %[output:10daf3d2]
lsim(A-B*K,10,[],T); %[output:5a7881cd] %[output:10daf3d2]

hold on %[output:10daf3d2]
yyaxis right %[output:10daf3d2]
lsim(A,10,[],T); %[output:32f4995f] %[output:10daf3d2]


figure(507) %[output:95769d76]
ii=1;
for T=logspace(-1,1,5) %[output:group:50be2d34]
subplot(5,1,ii) %[output:95769d76]
lsim(A-B*K,2,[],T); %[output:82bf648f] %[output:8157c9b6] %[output:2d5b55fe] %[output:688379fb] %[output:6b3d2d64] %[output:95769d76]
ii=ii+1 %[output:7e1ccc6a] %[output:864253a9] %[output:0eb5c2d6] %[output:2c905b98] %[output:95c55c30]
end %[output:group:50be2d34]

%%
%[text] ## H2 LMI
%[text] $A^T P +PA +\\gamma^{-1}PBB^T P + C^TC  \\leq 0$
%[text] $\\left\[\\matrix{A^TP +PA  +C^TC & PB  \\cr (PB)^T & -\\gamma I} \\right\] \<0$
%[text] 
nx=2;
nu=2;
ny=2;

ha=3; % A truncature order
hP=10 ;%number of phasors in P, decision variable
h=10; %LMI truncature order

T=3; %period

A=PhasorArray.random(nx,nx,ha);
figure(500)
clf %[output:59fc5b59]
A.plot(T) %[output:59fc5b59]
figure(501)
clf %[output:6f918f5f]
plot(A.HmqNEig,'*') %[output:6f918f5f]


B=PhasorArray.random(nx,nu,ha);
C=PhasorArray.random(ny,nx,ha);

gam=PhasorArray.ndsdpvar(1,1,0)*eye(nu) %[output:22b0e88f]

%sdpvar phaseur array
P = PhasorArray.ndsdpvar(nx,nx,hP);
PT=P.T_tb(h);

Q=C.'*C;
QT=Q.T_tb(h);

[AHpJ,AJHm,AHp,AHm]=A.TBHankel(h);
[AtHpJ,AtJHm,AtHp,AtHm]=TBHankel(A.',h);

[PHpJ,PJHm,PHp,PHm]=P.TBHankel(h);
[BHpJ,BJHm,BHp,BHm]=B.TBHankel(h);

ATB=A.T_tb(h);
BTB=B.T_tb(h);


F0=[PT>=0] %[output:26499f41]

F11=-[ATB'*PT+PT*ATB+...
AtHp*PHm+PHp*AHm+...
AtJHm*PHpJ+PJHm*AHpJ+...
N_tb(A,h,T)*PT-PT*N_tb(A,h,T)+QT];

F12=[PT*BTB+PHp*BHm+PJHm*BHpJ];

F21=F12';

F22=-gam.T_tb(h);

F1=[F11,F12;F21,F22];


F=[F0,F1<=0] %[output:222b1a28]

obj=trace(gam{:,:,0}) %[output:9639fd3c]
optimize(F,obj) %[output:472bee16] %[output:10b49f9f]


PP=PhasorArray(value(P.value)) %[output:7c94a336]
figure(601) %[output:4deb4035]
plot(PP,T,'title','P(t)') %[output:4deb4035]

K=value(value(gam))\(B.'*PP) %[output:918395ab]

figure(602) %[output:701accf2]
plot(K,T,'title','K(t)') %[output:701accf2]

figure(603) %[output:7f9e8273]
plot((HmqNEig(A-B*K,10,T)),'*') %[output:7f9e8273]
hold on %[output:7f9e8273]
plot((HmqNEig(A,10,T)),'o') %[output:7f9e8273]

figure(604) %[output:26b60f1a]
lsim(A-B*K,10,[],T); %[output:325924cf] %[output:26b60f1a]

figure(605) %[output:364c6655]
lsim(A,10,[],T); %[output:01f10736] %[output:364c6655]


%%
figure(607) %[output:3d484172]
ii=1 %[output:2e24d2c4]
for T=logspace(-1,1,5) %[output:group:7041f978]
subplot(5,1,ii) %[output:3d484172]
lsim(A-B*K,2,[],T); %[output:97723662] %[output:875876c2] %[output:0ea11f85] %[output:88aaee61] %[output:04915306] %[output:3d484172]
ii=ii+1 %[output:67504616] %[output:6fd3f4df] %[output:9d99af0a] %[output:87bd736f] %[output:14b9c6af]
end %[output:group:7041f978]


